import React from 'react';
import './style.css';
import { AppBar, Toolbar, MenuIcon, Button, IconButton, Typography } from '@material-ui/core';

function Navbar () {
    return(
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    
                </IconButton>
                <Typography variant="h6">
                    Car Maintenance
                </Typography>
                <Button color="inherit" alignSelf="flex-end">Login</Button>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar;
